import React from 'react';
import './Partners.css';
import Divider from '../image/SwirlDivider.png';
import MOC from '../image/MoC.png';
import IIT from '../image/IIT.png';
import IGNOU from '../image/ignou.png';

function Partners() {
    return (
        <div >
            <div class="partcard">
                <img src={MOC} className='partimg' alt="MoC"/>
                <h3>Ministry of Culture</h3>
                <p>Government of India</p>
            <button class=" partbtn" ><span>Explore </span></button>

            </div>
            <div class="partcard1">
            <img src={IIT} className='partimg1' alt="IIT"/>

            <button class=" partbtn" ><span>Explore </span></button>

            </div>
            <div class="partcard2">
            <img src={IGNOU} className='partimg2' alt="IGNOU"/>

            <button class=" partbtn" ><span>Explore </span></button>

            </div>
            <img src={Divider} alt="Caption Divider" style={{ width: '150px', height: '25px', marginTop:'30px', marginLeft: '800px', backgroundColor:'transparent' }} />

        </div>
    )
}

export default Partners
